      <p>I am John, a recent graduate from University of California Irvine and current reside in CA, USA. </p>
      <p>I enjoy the pursuit of ccraft, solving complex problems and helping others.</p>
      <p>In terms of hobbies, I enjoy travel, hiking, and seeking for yummy food!</p>
      <br /><br />
      
    </div>
  )
}

export default About
